package laporan4;

/**
 * @author asrul
 *
 */
public class DoWhileDemo {

	/**
	 * @param args
	 */
	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int hitung = 1;
		do {
			System.out.println("Hitungan : " + hitung);
			hitung++;
		} while (hitung <= 20);
	}

}
